import itertools
import timeit


class Solution:
    def lengthOfLongestSubstring(self, s: str) -> int:
        char_set = set()
        j = 0
        result = 0
        for i in range(0, len(s)):
            while s[i] in char_set:
                char_set.remove(s[j])
                j += 1
            char_set.add(s[i])
            result = max(result, i - j + 1)
        return result


